 node_block += ' (F)' if primitive_has_failures? primitive, node_name # Generate the report message for the operation status calculation # @param [Array<Hash>] operations # @param [Hash<String => String>] resource # @param [String] node_name # @return [String] def resource_operations_report(operations, resource, node_name) report = "Operations status debug start for the node: '#{node_name}'
" report += "Resource: '#{resource['id']}'
" operations.each do |operation| type = operation.fetch('operation', '?').capitalize rc_code = operation.fetch('rc-code', '?') op_code = operation.fetch('op-status', '?') report += "* #{type.ljust 7}: rc:#{rc_code} op:#{op_code}
" end report += "Status: #{resource['status']} Failed: #{resource['failed']}
" report + "Operations status debug end for the node: '#{node_name}'
" end
